class Hello{
	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner){
		this.log = log
		this.context = context
		this.testRunner = testRunner
	}
	 def sayHello(String name){
	  log.info ("   Hello " + name);
	 }

}

context.setProperty("Hello", new Hello(log, context, testRunner))

project = testRunner.testCase.testSuite.project ;
 tcase = project.testSuites["TestSuite3"].testCases["TestCase1"] ; 
 hello = tcase.getTestStepByName("Hello");

hello.run(testRunner, context)

context.Hello.sayHello("Mario")

//Groovy - run request from another TestCase or TestSuite
project = testRunner.testCase.testSuite.project ;
tcase = project.testSuites["TestSuite3"].testCases["TestCase2"] ; 
tstep = tcase.getTestStepByName("GetCountryISOCode");
def status = tstep.run(testRunner, context)
def result = status.getStatus().toString();
log.info ("   ----   "+result)

def projectName=testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("REST Project 1")
def runStatus = projectName.run(null,true)
//projectName.run(new com.eviware.soapui.support.types.StringToObjectMap(), false)
Thread.sleep(6000)
log.info ("   >>>   status is : " + runStatus.getStatus().toString())

/************* Run a particular test case inside the same Test Suite ****************/

def tCase = testRunner.testCase.testSuite.testCases["TestCase2"]
def prop = new com.eviware.soapui.support.types.StringToObjectMap()
runner = tCase.run(prop, false);

log.info ("   >>>   "+runner.getStatus().toString())


/************* Show the test case name inside the test suite ****************/
